**1. Dead Code Elimination**

Dead code elimination is a technique where the compiler removes code that does not affect the program's output. This can include code that is unreachable or code that has no side effects.

Example:
```c
int foo() {
    int x = 5;
    return 10; // x is not used
}
```
Optimized code:
```c
int foo() {
    return 10;
}
```
**2. Constant Folding**

Constant folding is a technique where the compiler evaluates constant expressions at compile-time and replaces them with their results.

Example:
```c
int foo() {
    return 2 + 3;
}
```
Optimized code:
```c
int foo() {
    return 5;
}
```
**3. Copy Propagation**

Copy propagation is a technique where the compiler replaces a variable with a copy of another variable if the original variable is not modified.

Example:
```c
int foo() {
    int x = 5;
    int y = x;
    return y;
}
```
Optimized code:
```c
int foo() {
    return 5;
}
```
**4. Dead Store Elimination**

Dead store elimination is a technique where the compiler removes assignments to variables that are not used.

Example:
```c
int foo() {
    int x = 5;
    x = 10; // x is not used after this assignment
    return 20;
}
```
Optimized code:
```c
int foo() {
    return 20;
}
```
**5. Loop Unrolling**

Loop unrolling is a technique where the compiler increases the number of iterations in a loop to reduce the overhead of loop control statements.

Example:
```c
void foo() {
    int i;
    for (i = 0; i < 4; i++) {
        printf("Hello\n");
    }
}
