Here are some key characteristics of static members:

1. **Shared by all instances**: A static member is shared by all instances of a class, which means that only one copy of the member exists, regardless of how many instances of the class are created.
2. **No instance required**: You don't need to create an instance of a class to access a static member. You can access it directly using the class name.
3. **No inheritance**: Static members are not inherited by derived classes.
4. **No polymorphism**: Static members cannot be overridden by derived classes.

