```
#include <stdio.h>
#include <stdlib.h>
#include <string.h>

// Structure to represent a block of memory
typedef struct {
    size_t size;
    int free;
    struct block* next;
} block;

// Global pointer to the head of the free list
block* free_list = NULL;

// Function to initialize the memory allocator
void init_allocator(size_t size) {
    free_list = (block*)malloc(size);
    free_list->size = size - sizeof(block);
    free_list->free = 1;
    free_list->next = NULL;
}

// Function to allocate memory
void* malloc(size_t size) {
    block* current = free_list;
    block* previous = NULL;

    // Find a free block that is large enough
    while (current != NULL) {
        if (current->free && current->size >= size) {
            break;
        }
        previous = current;
        current = current->next;
    }

    // If no free block is found, return NULL
    if (current == NULL) {
        return NULL;
    }

    // Split the block if it is too large
    if (current->size > size + sizeof(block)) {
        block* new_block = (block*)((char*)current + size);
        new_block->size = current->size - size - sizeof(block);
        new_block->free = 1;
        new_block->next = current->next;
        current->size = size;
        current->next = new_block;
    }

    // Mark the block as allocated
    current->free = 0;

    // Return the allocated memory
    return (void*)((char*)current + sizeof(block));
}

// Function to allocate memory and initialize it to zero
void* calloc(size_t num, size_t size) {
    size_t total_size = num * size;
    void* ptr = malloc(total_size);
    if (ptr != NULL) {
        memset(ptr, 0, total_size);
    }
    return ptr;
}

